import {
  createBrowserRouter,
  Routes,
  Route,
  Link,
  NavLink,
  createRoutesFromElements,
  RouterProvider
} from 'react-router-dom';

// pages
import Home from './pages/Home'
import About from './pages/About'

const router = createBrowserRouter(
  createRoutesFromElements(
    <Routes>
      <Route index element={ <Home /> }/>
      <Route path="about" element={ <About /> }/>
    </Routes>
  )
)

function App() {
  return (

    // <header>
